<>

<div class="col-lg-6 textimg categories1">
        <div class="image-container" style={imageStyle}>
          <div class="image-content">
            <h2>{data}</h2>
            <p>{para}</p>
            <button class="btn btn-primary">{clicktext}</button>
          </div>
        </div>
      </div>







</>
  )
}

export default Topcenter
